import circle from './files/circle.png';
import react from './files/react.png';

function Images(){
    return(
        <div>
            <img src={circle} alt="" style={{"height" : "65px", "width" : "65px"}}></img>
            <img src={react} alt="" style={{"height" : "65px", "width" : "65px"}}></img>
        </div>
    );
}

export default Images;
